import React from 'react';
import { Navigate, Route } from 'react-router-dom';


const AdminProtectedRoute = ({ component: Component, ...rest }) => (
    <Route {...rest} render={(props) => (
        localStorage.getItem('') === 'true'
        ? <Component {...props} />
        : <Navigate to='/' />
    )} />
    );

export default AdminProtectedRoute;
